import React from "react";

function AccordionProto(props) {
    return (
        <>
            <div>
                <div>
                    <p>{props.ques}</p>
                    <button></button>
                </div>
                <div>
                    <p>{props.desc}</p>
                    <button></button>
                </div>
            </div>
        </>
    )
}
export default AccordionProto;
